import { seenOnBway } from "./seenOnBway";

function listShows(props) {
    const shows = props.map(props => {
        const showList = props.data
        .map(({seenOnBway}) => {
        return (
            <li>
            Show: {seenOnBway.id}<br />
            Show Type: {seenOnBway.showType}<br />
            Theatre: {seenOnBway.theatre}<br />
            Date Seen: {seenOnBway.seenOn}<br />
            Rating out of 5 stars: {seenOnBway.stars}
            </li>
        );
    });
    return (<ul>{shows}</ul>);
})}
    export default listShows;
